const LevelsSection = ({ gem, level, scores, className, interaction }) => {
  const navigate = useNavigate();
  const getInteractinStatus = () => {
    if (interaction === 0) {
      return "خیلی کم";
    } else if (interaction === 1) {
      return "کم";
    } else if (interaction === 2) {
      return "متوسط";
    } else if (interaction === 3) {
      return "زیاد";
    } else if (interaction === 4) {
      return "خیلی زیاد";
    }
  };
  const getInteractinValue = () => {
    if (interaction === 0) {
      return 0;
    } else if (interaction === 1) {
      return 25;
    } else if (interaction === 2) {
      return 50;
    } else if (interaction === 3) {
      return 75;
    } else if (interaction === 4) {
      return 100;
    }
  };
  return (
    <div>
      <div
        className={
          className +
          " m-0 p-0 d-flex flex-row justify-content-between align-items-center"
        }
      >
        {/* ======================================= */}
        <div className="level-holder m-0 p-0 d-flex flex-column justify-content-start align-items-center">
          <span
            id="landing-placementTest"
            style={{ border: "0" }}
            className="m-0 p-0 level-box "
          >
            <img className="level-bg-outer" alt="..." src={levelOuterIcon} />
            <img className="level-bg-inner" alt="..." src={levelInnerIcon} />
            <span className="level-info m-0 p-0 d-flex flex-column justify-content-center align-items-center">
              <span className="level-num m-0 p-0"> {level} </span>
              <span className="level-text m-0 m-1 p-0">LEVEL</span>
            </span>
          </span>

          <span className="m-0 mt-1 p-0">سطح</span>
          <span className="m-0 p-0"> {level} </span>
        </div>
        {/* ======================================= */}
        <div className="rate-number  m-0 p-0">
          <RateHolder num={scores} />
        </div>
        {/* ======================================= */}

        <div
          id="landing-jems"
          className="jems-number mb-1 m-0 p-0 d-flex flex-column justify-content-center align-items-center"
        >
          <img className="jem-icon" alt="..." src={jemIcon} />
          <span className="m-0 p-0">جم</span>
          <span className="m-0 p-0">{gem}</span>
        </div>
      </div>

      <div className="activities m-0 my-4 p-0 d-flex flex-column justify-content-center align-items-center">
        <input
          readOnly
          dir="ltr"
          type="range"
          min="1"
          max="100"
          value={getInteractinValue()}
          className="range-slider"
          id="myRange"
        />
        <div
          style={{ width: `calc(${getInteractinValue()}% - 8px)` }}
          className="fill-value"
        ></div>
        <span className="fs-7 mt-3">
          {`میزان فعالیت امروز : ${getInteractinStatus()} `}
        </span>
      </div>

      {/* *************** */}
      <Button
        className="w-100 py-2 mb-3"
        variant="contained"
        color="primary"
        onClick={() => {
          navigate("/level-determine");
        }}
      >
        تعیین سطح
      </Button>
    </div>
  );
};

export default LevelsSection;
